// Importamos la librería de FontAwesome:
import ReactDOM from 'react-dom'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const CartWidget = () => {
    const amount = 2;
    return ( 
        <>
        <ion-icon name="cart-outline"></ion-icon>
        {amount} 
        </>  
    );
}
 
export default CartWidget;
